import React from 'react'

const FullcarsCard = () => {
    const cars = [
        {
          name: "Creta Hyundai",
          type: "SUV",
          discount: "16% Off!",
          price: "$210",
          oldPrice: "$250",
          rating: "4.7 ★",
          image: "https://via.placeholder.com/150",
        },
        {
          name: "Innova Crysta",
          type: "Economy",
          discount: "10% Off!",
          price: "$351",
          oldPrice: "$390",
          rating: "3.9 ★",
          image: "https://via.placeholder.com/150",
        },
        {
          name: "Toyota Etios",
          type: "Compact",
          discount: "20% Off!",
          price: "$192",
          oldPrice: "$240",
          rating: "4.5 ★",
          image: "https://via.placeholder.com/150",
        },
        {
          name: "Mahindra XUV500",
          type: "Economy",
          discount: "15% Off!",
          price: "$374",
          oldPrice: "$440",
          rating: "4.2 ★",
          image: "https://via.placeholder.com/150",
        },
      ];
      
  return (
    <div>
      
    </div>
  )
}

export default FullcarsCard
